import { useCallback, useEffect, useState } from "react";
import { useSearchParams } from "react-router-dom";
import { resourceLimits } from "worker_threads";
import { bayutUrl, fetchApi } from "../../utiles/fetchApi";
import { Container, SubText, TextContainer, Title } from "./styles";

export default function PropertyDetails() {
  const [searchParams] = useSearchParams();

  const id = searchParams.get(":externalID");

  const [PropertyArray, setPropertyArray] = useState([
    {
      title: "default 1",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      image: "NA",
    },
    {
      title: "default 2",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      image: "NA",
    },
    {
      title: "default 3",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      image: "NA",
    },
  ]);

  const getResults = useCallback(async () => {
    const results = await fetchApi(
      `${bayutUrl}'/properties/detail?externalID=${id}`
    );
    const searchData = results.hits;
    setPropertyArray(searchData);
  }, [id]);

  useEffect(() => {
    getResults();
  }, [getResults]);

  return (
    <Container>
      <Title>PropertyDetails </Title>
      <>
        {PropertyArray.map((array) => {
          return (
            <>
              title={array.title}
              baths={array.baths}
              rooms={array.rooms}
              price={Number(array.price)}
              image={array.image}
            </>
          );
        })}
      </>

      <TextContainer></TextContainer>
    </Container>
  );
}
